import './App.css';
import {Route, Router, Routes} from "react-router-dom";
import Record from "./pages/record";


function App() {
    return (
        <Router>
            <Routes>
                <Route path="/record" element={<Record />} />
            </Routes>
        </Router>
    );
}

export default App;
